import logo from './logo.svg';
import './App.css';
import APIClient from './apiClient'

function App() {
  let api = new APIClient("accessToken");
  return (
    <div className="App">
      {api.generations()}
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
    </div>
  );
}

export default App;
